import axios from 'axios';
import React, { useState, useEffect } from 'react';
import DatePicker from 'react-datepicker';
import 'react-datepicker/dist/react-datepicker.css';
import styled from 'styled-components';

function BookingForm() {
    const [fromDate, setFromDate] = useState(null);
    const [fromTime, setFromTime] = useState(null);
    const [toDate, setToDate] = useState(null);
    const [toTime, setToTime] = useState(null);
    const [bookedDates, setBookedDates] = useState([]);

    useEffect(() => {
        let config = {
            method: 'get',
            maxBodyLength: Infinity,
            url: 'http://localhost/car/KLTN/carrentalAPI/Get_DateBooking.php?vid=2',
            headers: {},
        };

        axios
            .request(config)
            .then((response) => {
                if (response.data.status === '200') {
                    setBookedDates(response.data.date);
                }
            })
            .catch((error) => {
                console.log(error);
            });
    }, []);

    const handleFromDateChange = (date) => {
        setFromDate(date);
        setToDate(null); // Reset toDate when changing fromDate
    };

    const handleFromTimeChange = (time) => {
        setFromTime(time);
    };

    const handleToDateChange = (date) => {
        setToDate(date);
    };

    const handleToTimeChange = (time) => {
        setToTime(time);
    };

    const handleBooking = () => {
        console.log('From Date:', fromDate);
        console.log('From Time:', fromTime);
        console.log('To Date:', toDate);
        console.log('To Time:', toTime);
    };

    const isBookedDateTime = (dateTime) => {
        return bookedDates.includes(dateTime.toISOString());
    };

    const renderDateTime = (dateTime) => {
        const isBooked = isBookedDateTime(dateTime.toISOString());
        const isFutureDateTime = dateTime > new Date();

        const dateTimeClassName = isBooked ? 'booked-date-time' : '';
        const additionalClass = isFutureDateTime ? '' : 'disabled-date-time';

        return (
            <div className={`custom-date-time ${dateTimeClassName} ${additionalClass}`}>
                {dateTime.toLocaleString()}
            </div>
        );
    };

    const excludeDates = bookedDates.map((dateTime) => new Date(dateTime));
    const today = new Date();
    const minDate = new Date(today.getFullYear(), today.getMonth(), today.getDate());

    const filterPassedDateTime = (dateTime) => {
        return dateTime > fromDate || !fromDate; // Hiển thị ngày/giờ sau fromDate hoặc không có fromDate
    };

    return (
        <BookDiv>
            <div className="form-group">
                <label>From Date:</label>
                <DatePicker
                    selectsStart
                    selected={fromDate}
                    minDate={minDate}
                    startDate={fromDate}
                    endDate={toDate}
                    onChange={handleFromDateChange}
                    renderDay={renderDateTime}
                    excludeDates={excludeDates}
                    className="form-control"
                    placeholderText="Chọn ngày nhận xe"
                />
            </div>
            <div className="form-group">
                <label>From Time:</label>
                <DatePicker
                    selected={fromTime}
                    onChange={handleFromTimeChange}
                    showTimeSelect
                    showTimeSelectOnly
                    timeIntervals={15}
                    dateFormat="h:mm aa"
                    className="form-control"
                    placeholderText="Chọn giờ nhận xe"
                />
            </div>
            <div className="form-group">
                <label>To Date:</label>
                <DatePicker
                    selectsEnd
                    selected={toDate}
                    minDate={fromDate || minDate} // Chỉ cho phép chọn ngày từ fromDate trở đi
                    startDate={fromDate}
                    endDate={toDate}
                    onChange={handleToDateChange}
                    renderDay={renderDateTime}
                    excludeDates={excludeDates}
                    className="form-control"
                    placeholderText="Chọn ngày trả xe"
                    filterDate={filterPassedDateTime}
                />
            </div>
            <div className="form-group">
                <label>To Time:</label>
                <DatePicker
                    selected={toTime}
                    onChange={handleToTimeChange}
                    showTimeSelect
                    showTimeSelectOnly
                    timeIntervals={15}
                    dateFormat="h:mm aa"
                    className="form-control"
                    placeholderText="Chọn giờ trả xe"
                />
            </div>
            <button onClick={handleBooking}>Booking</button>
        </BookDiv>
    );
}

const BookDiv = styled.div`
  .form-group {
    margin-bottom: 1rem;
  }

  .form-label {
    margin-bottom: 0.5rem;
  }

  .form-control {
    border: 1px solid #ced4da;
    border-radius: 0.25rem;
    padding: 0.375rem 0.75rem;
    line-height: 1.5;
  }

  .custom-date-time.disabled-date-time {
    background-color: #f8d7da;
    color: #721c24;
    cursor: not-allowed;
    text-decoration: line-through;
    color: red;
  }
`;

export default BookingForm;
